The root type of the error hierarchy is ZksyncError. For example, the error GenericError from the domain Anvil and its component AnvilEnvironment is instantiated as follows: ZksyncError::Anvil(// Domain Anvil::AnvilEnvironment ( // Component AnvilEnvironment::GenericError { // Error message: "hello!".to_string() }) ); You don't need to construct this instance explicitly -- there are adapters implementing Into for every use case: from errors to domain errors types e.g. Anvil; from errors to component errors types e.g. AnvilEnvironment; from errors to the root type ZksyncError; from domain errors to ZksyncError; from anyhow::Error to component errors. See the examples below: // This works:
let err : ZksyncError = AnvilEnvironment::GenericError { message: "hello!".to_string() }.into(); // instead of passing type to `into` where type derivation does not work
let err_same = AnvilEnvironment::GenericError { message: "hello!".to_string() }.to_unified(); // Also works:
fn test() -> Result<(), ZksyncError> { Err(AnvilEnvironmentError::GenericError { message: "Oops".to_string(), })?; Ok(())
} // Also works:
fn test_domain() -> Result<(), AnvilError> { Err(AnvilEnvironmentError::GenericError { message: "Oops".to_string(), })?; Ok(())
} // anyhow -> component, produces the default GenericError belonging to this component
fn test_anyhow() -> Result<(), AnvilEnvironmentError> { Err(anyhow::anyhow!("Oops"))?; Ok(())
} // fn test_domain() -> Result<(), AnvilError> { Err(AnvilEnvironmentError::GenericError { message: "Oops".to_string(), })?; Ok(())
}
